import React, { useState } from 'react';
import './navbar.css';
import { Link } from 'react-router-dom';

function MyNavbar() {

  const handleClick = () => {
    document.getElementById("hamburgerMenu").style.display = "none";
    document.getElementsByClassName("sidebar")[0].style.display = "flex";
  }

  const closeBtn = () => {
    document.getElementById("hamburgerMenu").style.display = "block";
    document.getElementsByClassName("sidebar")[0].style.display = "none";
  }

  return (
      <div>
        <span className="material-symbols-outlined" id='hamburgerMenu' onClick={handleClick} style={{fontWeight:'800', fontSize:'3.5rem', color: 'white'}}>menu</span>
        <div className="sidebar">
          <span className="material-symbols-outlined" id='closeBtn' style={{fontSize:'2rem', fontWeight:'bold'}} onClick={closeBtn}>close</span>
          <h1 style={{margin: '20px 0'}}>Menu</h1>
          <Link to='/home'>
            <div className='sidebarItem'>
              <h2>Home</h2>
              <span className="material-symbols-outlined">home</span>
            </div>
          </Link>
          <Link>
            <div className='sidebarItem'>
              <h2>Ãœbungen</h2>
              <span className="material-symbols-outlined">fitness_center</span>
            </div>
          </Link>
          <div className='sidebarItem'>
            <h2>Rezepte</h2>
            <span className="material-symbols-outlined">restaurant</span>
          </div>
          <div className='sidebarItem'>
            <h2>Einstellungen</h2>
            <span className="material-symbols-outlined">settings</span>
          </div>
        </div>
      </div>
  );
}

export default MyNavbar;
